import React from "react";
import {
	LineChart,
	Line,
	XAxis,
	YAxis,
	CartesianGrid,
	Tooltip,
	Legend,
	ResponsiveContainer,
} from "recharts";

import { GraficoContainer, GraficoTitulo } from "./GraficoElementos";

const Grafico = () => {
	return (
		<>
			<GraficoContainer>
				<GraficoTitulo>Analise de Vendas</GraficoTitulo>
			</GraficoContainer>
		</>
	);
};

export default Grafico;
